  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112340 includes biological,
  chemical, discrete sample, physical and profile data collected from HAKUREI MARU
  in the Coral Sea, North Pacific Ocean, South Pacific Ocean and Tasman Sea from 1995-04-14
  to 1995-06-12 and retrieved during cruise NH95-1 and PACIFICA_49HG19950414. These
  data include ALKALINITY, CHLOROPHYLL A, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
  HYDROSTATIC PRESSURE, NITRATE + NITRITE CONTENT (CONCENTRATION), NITRITE, PHOSPHATE,
  SALINITY, SILICATE, WATER TEMPERATURE and pH. The instruments used to collect these
  data include CTD, Coulometer for DIC measurement and bottle. These data were collected
  by Akira Nishimura of Geological Survey of Japan and Yutaka W. Watanabe of National
  Institute for Resources and Environment as part of the PACIFICA_49HG19950414 data
  set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
  project for the data synthesis of ocean interior carbon and its related parameters
  in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
  of Carbon and Climate (S-CC) supported the project.\",\n\t\"license_title\": null,\n\t\"extras\":
